import React from "react";
import { View ,Text} from "react-native";

const style =() =>{
  return(
    <View>
      <Text>Meu Primeiro Teste com vermelho</Text>
      <Text>Meu Segundo teste com a cor azul</Text>
    </View>

  );
}
export default style;
